  input: '"TEXT","F3XN","C00034033","1. The SCGOP is using the following best effort
    to obtain identification of all individuals who contribute in excess of $200.  Our
    original solicitation includes a clear and conspicuous request for this information
    which includes the requirements of the federal law to provide such information.  If
    the information is not provided, we make a follow up effort per phone.  If the
    needed information is still not provided, we search the internet to obtain the
    information.  2. The $ 250 disbursement from our Federal Account to our Non-Federal
    Account on 6/30/04 was for a contribution by John M. Templeton Jr, M. D., 601
    Pembroke Rd, Bryn Mawr, Pennsylvania 19010, which was erroneously deposited into
    our Federal Account. 3. The SCGOP is forgiving the debt to Napier for Congress
    on Schedule D.  This committee no longer exists.  We believe the committee filed
    a termination report in 1984. 4. The disbursements on Schedule B to Postmaster
    for $ 238 and $ 12.49 for postage and to Starboard for $20,191 were for general
    fundraising and did not refer to a clearly identified candidate for Federal office,
    nor did it promote, support, attack, or oppose any candidate for Federal office.
    5. The disbursement on Schedule H4 to Sunny Philips for $ 100 was for general
    research and did not refer to a clearly identified candidate for Federal office,
    nor did it promote, support, attack, or oppose any candidate for Federal office."'
